import React, {Component} from "react";

class Background extends Component{

	render(){
		return(
			<svg className="backgroundSVG" viewBox="0 0 100 50">

			  <circle r="10" cx="100" cy="50" fill="#f00" />
			</svg>
		);
	}
}

export default Background;
